export var FETCH_MODULE_REQUEST = "FETCH_MODULE_REQUEST";
export var FETCH_MODULE_SUCCESS = "FETCH_MODULE_SUCCESS";
export var FETCH_MODULE_FAILURE = "FETCH_MODULE_FAILURE";
export function fetchModuleRequest(id) {
  return {
    type: FETCH_MODULE_REQUEST,
    id: id
  };
}
export function fetchModuleSuccess(module) {
  return {
    type: FETCH_MODULE_SUCCESS,
    module: module
  };
}
export function fetchModuleFailure(error) {
  return {
    type: FETCH_MODULE_FAILURE,
    error: error
  };
}
